import styled from "styled-components";
import { useNavigate } from "react-router-dom";

const Section03Section = styled.section`
  padding: var(--padding-sec);

  & img {
    width: 3rem;
  }
`;

const Section03Text = styled.div`
  & h3 {
    color: var(--black-01);
    font-size: 4rem;
    font-weight: 700;
  }

  & p {
    color: var(--grey-01); /* 변수명 확인 */
    font-size: 2.4rem;
    font-weight: 600;
  }

  & input {
    border: none;
    outline: none;
    border-bottom: 3px solid var(--black-01);
    width: 80%;
    padding: 1.3rem;
    font-size: 2rem;
  }

  & input::placeholder {
    font-size: 2rem;
  }

  & button {
    border: none;
    background: none;
  }

  & button > i {
    font-size: 2rem;
  }
`;

const Section03TagWrapper = styled.div`
  position: relative;
  width: 41.9rem;
  height: 31.8rem;
`

const TagWrapperTag01 = styled.div `
  padding: 10px 20px;
  width: 14.5rem;
  border-radius: 30px 30px 0 30px;
  background: var(--sub-Color4);
  position: absolute;
  top: 7.55%;
  left: 20.53%;
  transform: translate(0, 0);
  box-shadow: 3px 13px 25.4px 0px rgba(0, 0, 0, 0.15);
  display: flex;
  align-items: center;
  cursor: pointer;
  transition: all 0.3s ease-out;
  z-index: 1;

  & img {
  width: 4.2rem;
  height: 3rem;
  display: flex;
  justify-content: center;
  align-items: center;
  transition: transform 0.3s ease;
  }

  
`

function Section03 () {
  return (
    <Section03Section>
      <div className="container d-flex">
        <div className="col-md-6">
          <Section03Text>
            <h3>지금 나에게 필요한건?</h3>
            <p className="mb-45">부평시장의 다양한 상점을 소개합니다!</p>
            <div className="input_wrapper d-flex">
              <input type="text" placeholder="국내산 한우 차돌박이를  검색해보세요!" />
              <button onClick={() => navigator("/market")}>
                <i className="xi-arrow-right"></i>
              </button>     
            </div>
          </Section03Text>
        </div>
        <div className="col-md-6 tag_wrapper">
          <div className="tag01 d-flex">
            <a href="assets/pages/market.html">
              <img src="assets/images/sec03_icon_fish.png" alt="" />
            </a>
            <p>생선</p>
          </div>
          <div className="tag02 d-flex">
            <img src="assets/images/sec03_icon_meat.png" alt="" />
            <p>고기</p>
          </div>
          <div className="tag03 d-flex">
            <img src="assets/images/sec03_icon_fruit.png" alt="" />
            <p>과일</p>
          </div>
          <div className="tag04 d-flex">
            <img src="assets/images/sec03_icon_clothes.png" alt="" />
            <p>의류</p>
          </div>
          <div className="tag05 d-flex">
            <img src="assets/images/sec03_icon_detergent.png" alt="" />
            <p>생활용품</p>
          </div>
          <div className="tag06 d-flex">
            <img src="assets/images/sec03_icon_vege.png" alt="" />
            <p>채소</p>
          </div>
        </div>
      </div>
    </Section03Section>
  );
}

export default Section03;
